import React from "react";

function App() {
  var counter = 0;

  const func = () => {
    console.log("hello world");
    counter += 1;
  };

  return (
    <div>
      <h1>Hello world!</h1>
      <button onClick={func()}>{counter}</button>
    </div>
  );
}

export default App;
